import React from "react";
import ServicesCard from "./ServicesCard";
import { Col } from "reactstrap";
import offer2 from "../assets/images/g.png";
import customaizationImg from "../assets/images/customization.png";
import offer1 from "../assets/images/offer1.jpeg"

const servicesData = [
  {
    imgurl: offer1,
    title: "New year, new adventures",
    desc: "Save 15% or more when you book and stay before April 1, 2024",
  },
  {
    imgurl: guideImg,
    title: "Best Tour Image",
    desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit",
  },
  {
    imgurl: customaizationImg,
    title: "Customization",
    desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit",
  },
];

const ServicesList = () => {

  return (
    <>
        {servicesData.map((item, index) => (
          <Col lg="3" key={index}>
            <ServicesCard item={item} />
          </Col>
        ))}
    </>
  );
};

export default ServicesList;
